import React from 'react';
import { LogisticContainer, LogisticPrimary } from '../components/address.styles';

export default function LogisticsAddress() {
  return (
    <LogisticContainer>
      <LogisticPrimary>Save New Address?</LogisticPrimary>
    </LogisticContainer>
  );
};
